import React, { Component } from 'react'
import AuthMenu from './auth_menu'
import TaskList from './task_list'

export default class LeftSide extends Component {
    render() {
        return (
<div class="col-xl-6 col-lg-6 col-md-6">
                <div class="card">
                    <div class="card-body">
                        <AuthMenu />
                        <TaskList />
                        

                        
                    </div>
                </div>
            </div>
        )
    }
}
